CREATE DEFINER=`root`@`localhost` PROCEDURE `get_my_events` (IN `uId` INT)  READS SQL DATA
SELECT p.*, e.*, a.firstname, a.lastname, a.tussenvoegsel, a.image, c.name AS categoryname
